def python_add_text(img, layer, text):

	l = pdb.gimp_layer_new(img, img.width, img.height, 1, "Text", 100, 0)
	l.visible = False
	img.add_layer(l, 0)

	region = l.get_pixel_rgn(0, 0, l.width, l.height, True)
	totalOffset = 0
	#space is 5 px
	for c in text:
		(offset, data) = LETTER_ARR_CITY[c]()
		if data != None:
			region[totalOffset:totalOffset+offset,:18] = data
		totalOffset += offset

	l.visible = True

